import React from "react";
import "./Adminlist.css";
import { FaPen } from "react-icons/fa";
import airpod from "./Images/adminlist_a_airpods.webp";
import swatch from "./Images/adminlist_s_watch.webp";


export default function Adminlist() {
  return (
    <>
      <div className="adminlist">
        <div className="adminlist_heading">
          <label>Image Product</label>
          <label>Producer</label>
          <label>Product</label>
          <label>ID</label>
          <label>Cat</label>
          <label>Link</label>
          <label>Cost</label>
          <label>Extra</label>
          <label>Price</label>
          <label>Priority</label>
          <label>Edit</label>
        </div>
        <div className="adminlist_middle">
          <Singleadminlist
            image={airpod}
            producer={"Apple"}
            product={"Air pods 2"}
            id={"p10001"}
            link={"apple-air-pods"}
          />
          <Singleadminlist
            image={swatch}
            producer={"Apple"}
            product={"Air pods 2"}
            id={"p10001"}
            link={"apple-air-pods"}
          />
          <Singleadminlist
            image={airpod}
            producer={"Apple"}
            product={"Air pods 2"}
            id={"p10001"}
            link={"apple-air-pods"}
          />
          <Singleadminlist
            image={airpod}
            producer={"Apple"}
            product={"Air pods 2"}
            id={"p10001"}
            link={"apple-air-pods"}
          />
          <Singleadminlist
            image={airpod}
            producer={"Apple"}
            product={"Air pods 2"}
            id={"p10001"}
            link={"apple-air-pods"}
          />
        </div>
        <div className="adminlist_end">
          <button>Load More Products</button>
        </div>
      </div>
    </>
  );
}

function Singleadminlist({ image, producer, product, id, link }) {
  return (
    <>
      <div className="singleadminlist">
        <div className="singleadminlist_row">
          <div className="singleadminlist_row_img">
            <input type="circledcheckbox"></input>
            <div>
              <img src={image} width={80} />
            </div>
          </div>

          <label>{producer}</label>
          <label>{product}</label>
          <label>{id}</label>
          <label>Tablets</label>
          <label>{link}</label>
          <span>$432</span>
          <span>20%</span>
          <span>$540</span>
          <span>1</span>
          <FaPen />
        </div>
      </div>
    </>
  );
}
